import sha256 from 'crypto-js/sha256'

const generateChecksum = (obj) => {
    const keys = Object.keys(obj)
    let str = ""
    keys.forEach(key => {
        str+=obj[key]
        str+="|"
    })
    return sha256(str)
}

export default generateChecksum
